import React from 'react';
import {useParams, useLocation} from 'react-router-dom';

// const User = ({match}) => {
//     return <h1>{match.params.fname} Page</h1>
// }

const User = () => {
    const {fname, lname} = useParams();
    const location = useLocation();
    return (
        <>
            <h1>{fname} {lname} Page</h1>
            <h1>Location: {location.pathname}</h1>
            {
                location.pathname === `/user/shrut/pradnya` ? 
                <button onClick={() => {
                    alert('you got me');
                }}>Click me</button> :
                null
            }
        </>
    );
}

export default User;
